import React from "react";

export const Tile = (props) => {
  return (
    <div className="tile-container">
      {props.info.map((contact) => {
        return (
          <div>
            <p>{contact.name}</p>
            <p>{contact.email}</p>
            <p>{}</p>
          </div>
        )
      })}
    </div>
  );
};
